import React from 'react'

export default function Todolist() {

    const mystyle = {backgroundColor: "red"}; 
    return (
        
        <>
        <div style = {mystyle}>
            div 1
        </div>
        <div>div 2</div>
        <div> div 3</div>
        <div> div 4</div>
        </>
    )
}
